import img1 from "../../images/vasitum-logo.png";
import dashboard from "../../images/ic_dashboard.png";
import { createContext, useState, useContext } from "react";
const ThemeContext = createContext(null);
function Sidemenu() {
    
    return (
        <div className="sidenav">
            <LogoFrame/>
            <FrameMainMenu/>
        </div>
    )
}

function LogoFrame() {
    return(
        <div className="logoframe">
            <div className="brandlogo">
                <img src={img1} alt="Vasitum logo"/>
            </div>
           

        </div>
        
    )


}

function FrameMainMenu() {
    return(
        <div  className="mainmenuframe">
            <div className="mainmenu">
            <div className="textmain">
                MAIN MENU</div>   
            </div>
            <ManuItems title="Dashboard"/>
            <ManuItems title="Rec" />
            <ManuItems title="Dashboard" />
            <ManuItems title="Dashboard" />
            <ManuItems title="Dashboard" />

        </div>
    )
}

function ManuItems({title}) {
    return (
        <div className="item">
           <div>
           <img src={dashboard} alt="" className="imgit"/>
           </div>
           <div><h1 className="mtext">{title}</h1> </div>

        </div>
    )
}

export default Sidemenu;
